column8:
　吸水速乾機能のドライセルにより着用時の快適性を高める機能を搭載したトランジションパンツが登場です。<br>

部分的に重ね使いしたメッシュパネルがデザインのアクセントとなっています。<br>

汎用性の高いデザインなのでパンツ単品で日常着として着用いただけますが、トランジションシリーズとセットアップとしても着用していただけます。<br>

■カラー：01 ( Cotton Black )、04 ( Light Gray Heather )<br>

■サイズ：M、L<br>

■素材：ストレッチ裏毛/コットン68%、ポリエステル25%、ポリウレタン7%<br>
